import React from 'react';

import { ContainerHeader } from './styles';
import logo from './../../assets/logo.png';

const Home = () => {
    return (
        <>
            <ContainerHeader>
                <img src={logo}></img>

            </ContainerHeader>
        </>
    )
}


export default Home;
